import React from "react";

import "./orders-card.styles.css";

import {
  ComponentContainer,
  LeftSide,
  RightSide,
  Quantity,
  Price,
  Img,
} from "./orders-card.styles";

const OrdersCard = ({
  id,
  descriptionTitle,
  imageUrl,
  price,
  rating,
  quantity,
}) => {
  return (
    <div className="orderCard__container">
      <div className="orderCard__leftSide">
        <strong>Description</strong>
        <div>{descriptionTitle}</div>
        <img alt="" src={imageUrl}></img>
      </div>
      <div className="orderCard__rightSide">
        <div>
          <strong>Quantity</strong>
          <div className="orderCard__quantity">{quantity}</div>
        </div>
        <div>
          <strong>Price</strong>
          <div className="orderCard__price">{price}</div>
        </div>
      </div>
    </div>
  );
};

export default OrdersCard;
